import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import BandMembers from './components/BandMembers';
import Events from './components/Events';
import AboutUs from './components/AboutUs';
import Contact from './components/Contact';

function App() {
  return (
    <div className="relative flex size-full min-h-screen flex-col bg-[#231e10] dark group/design-root overflow-x-hidden" style='font-family: "Plus Jakarta Sans", "Noto Sans", sans-serif;'>
      <div className="layout-container flex h-full grow flex-col">
        <Navbar />
        <div className="px-40 flex flex-1 justify-center py-5">
          <div className="layout-content-container flex flex-col max-w-[960px] flex-1">
            <Hero />
            <h2 className="text-white text-[22px] font-bold leading-tight tracking-[-0.015em] px-4 pb-3 pt-5">Meet the Band</h2>
            <BandMembers />
            <h2 className="text-white text-[22px] font-bold leading-tight tracking-[-0.015em] px-4 pb-3 pt-5">Events</h2>
            <Events />
            <h2 className="text-white text-[22px] font-bold leading-tight tracking-[-0.015em] px-4 pb-3 pt-5">About Us</h2>
            <AboutUs />
            <Contact />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
